INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES ("フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "フリーマーケット会場", 40, 0, 2, 10118, 1, 7, 8, "青空の下で謁見", 5118061, 0, 91002, "ペコリーヌとの出会い", 2834);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES ("ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "フリーマーケット会場", 40, 0, 2, 10118, 1, 7, 8, "未来の騎空団\nマスコット？", 5118062, 0, 91002, "マホとの出会い", 2835);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES ("ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "ランドソル市街地", 40, 0, 2, 10118, 1, 7, 8, "お嬢さまからの\n緊急依頼", 5118063, 0, 91002, "アキノとの出会い", 2837);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES ("ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "フリーマーケット会場", 40, 0, 2, 10118, 1, 18, 8, "黄金色の悩みごと", 5118064, 0, 91002, "ジュンとの出会い", 4108402);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES ("フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "フリーマーケット会場", 40, 0, 2, 10118, 1, 18, 8, "白熱！　格闘大会！", 5118065, 0, 91002, "カオリとの出会い", 4107402);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES ("太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "オーエド町", 40, 0, 2, 10118, 1, 16, 8, "祭り太鼓はオーエドの華", 5118066, 1, 91002, "ニノンとの出会い", 9000227);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES ("ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "フリーマーケット会場", 40, 0, 3, 10118, 1, 19, 8, "人気者は遅れて\nやってくる", 5118067, 0, 91002, "スズナとの出会い", 2101181);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES ("ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "ランドソル市街地", 40, 0, 3, 10118, 1, 18, 8, "巫女・ミーツ・魔法少女", 5118068, 0, 91002, "ナナカとの出会い", 4109402);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES ("ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "フリーマーケット会場", 40, 0, 3, 10118, 1, 18, 8, "ネズ耳は二度なくなる", 5118069, 0, 91002, "キャル＆コッコロとの出会い", 4305402);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES ("街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "ランドソル市街地", 40, 0, 3, 10118, 1, 18, 8, "この出会いにカンパイ！", 5118070, 0, 91002, "ユカリとの出会い", 4101402);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES ("ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "ランドソル市街地", 40, 0, 3, 10118, 1, 18, 8, "陰陽アンサンブル", 5118071, 0, 91002, "アオイとの出会い", 4106402);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES ("ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "フリーマーケット会場", 40, 0, 3, 10118, 1, 7, 8, "運試し十番勝負！", 5118072, 1, 91002, "シノブとの出会い", 2836);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (0, 0, 0, 10145115, 1, 10118, 0, 0, 0, "彼女たちの新たな日常", 5118600, 0, 0, "オープニング", 0);
